function _M.ReadCastInfo()

  local bridge_tracer = require "opentracing_bridge_tracer"
  local GenericObjectPool = require "GenericObjectPool"
  local CastInfoServiceClient = require 'media_service_CastInfoService'
  local ngx = ngx
  local cjson = require("cjson")

  local req_id = tonumber(string.sub(ngx.var.request_id, 0, 15), 16)
  local tracer = bridge_tracer.new_from_global()
  local parent_span_context = tracer:binary_extract(ngx.var.opentracing_binary_context)
  local span = tracer:start_span("ReadCastInfo", {["references"] = {{"child_of", parent_span_context}}})
  local carrier = {}
  tracer:text_map_inject(span:context(), carrier)

  ngx.req.read_body()
  local args = ngx.req.get_uri_args()
  
  if (_StrIsEmpty(args.cast_id) or _StrIsEmpty(args.num_casts)) then
    ngx.status = ngx.HTTP_BAD_REQUEST
    ngx.say("Incomplete arguments")
    ngx.log(ngx.ERR, "Incomplete arguments")
    ngx.exit(ngx.HTTP_BAD_REQUEST)
  end

  local cast_info_ids = {}    -- new array
  local num_cast_ids = 17000
  local chooseCastIdx = 0
  local chosenID = 0
  
  for i=1,tonumber(args.num_casts) do
    chooseCastIdx = math.random(1,num_cast_ids)
    chosenID = all_cast_ids[chooseCastIdx]
    table.insert(cast_info_ids, chosenID)
    -- print (all_cast_ids[chooseCastIdx])
  end
  
  local cast_info_ret = {}
  local client = GenericObjectPool:connection(
      CastInfoServiceClient, "cast-info-service", 9090)
  local status, ret = pcall(client.ReadCastInfo, client, req_id, cast_info_ids,carrier)
  GenericObjectPool:returnConnection(client)
  if not status then
    ngx.status = ngx.HTTP_INTERNAL_SERVER_ERROR
    if (ret.message) then
      ngx.say("Get read-cast-info failure: " .. ret.message)
      ngx.log(ngx.ERR, "Get  read-cast-info failure: " .. ret.message)
    else
      ngx.say("Get  read-cast-info  failure: : no return..")
      ngx.log(ngx.ERR, "Get  read-cast-info  failure: no return..")
    end
    ngx.exit(ngx.HTTP_INTERNAL_SERVER_ERROR)
  else
    local all_cast_infos = _LoadCastInfo(ret)
    ngx.header.content_type = "application/json; charset=utf-8"
    ngx.say(cjson.encode(all_cast_infos) )

  end
end

return _M
